import React,{Component} from "react";
import {Layout,Row,Col,Divider} from "antd";

class MianHeader extends Component{
    render() {
        return <Layout.Header>
            <h1 className="logo">cNode</h1>
            <Row className="wrap">
                <Col md={6} xs={24}>
                    <h1 class="logo">cNode</h1>
                </Col>
                <Col md={18} xs={0}></Col>

            </Row>
        </Layout.Header>;
    }
}

export default MianHeader;
